  return (
    <Paper className="page-info-panel mb-2">
      <div className="row">
        <div className="col-10">
          <p className="title">{title}</p>
          <p className="sub-title">{subtitle}</p>
        </div>
        <div className="col">
          <div className="btn-group text-right">
            <button
              className="btn btn-outline-primary"
              onClick={() => onRoute("new")}
